package com.externals;

/**
 * @author Slience
 * @version 1.0
 */
public class BlankCompatDisc {

    private final String title;
    private final String artist;

    public BlankCompatDisc(String title, String artist) {
        this.title = title;
        this.artist = artist;
    }

    public String getTitle() {
        return title;
    }

    public String getArtist() {
        return artist;
    }
}
